    # Clear UI elements
    sheet_listbox.delete(0, tk.END)  # Clear the sheet listbox
    footer_file_upload.config(text="No file uploaded.")  # Reset file upload footer
    footer_sheet_names.config(text="No sheet selected.")  # Reset sheet footer
