def show_progress_popup(task, *args, message="Processing, please wait..."):
    global task_running, task_should_terminate
    if task_running:
        if messagebox.askyesno("Task in Progress", "A task is already running. Do you want to terminate it?"):
            task_running = False
            task_should_terminate = True  # Mark task for termination
        else:
            return

    task_running = True
    task_should_terminate = False  # Reset termination flag

    # Create the popup window
    popup = tk.Toplevel(root)
    popup.title("Processing")
    popup.geometry("400x100")
    popup.resizable(False, False)
    popup.transient(root)
    popup.grab_set()  # Make it modal

    # Center the popup
    root.update_idletasks()
    root_width = root.winfo_width()
    root_height = root.winfo_height()
    root_x = root.winfo_x()
    root_y = root.winfo_y()
    popup_width = 400
    popup_height = 100
    x = root_x + (root_width - popup_width) // 2
    y = root_y + (root_height - popup_height) // 2
    popup.geometry(f"{popup_width}x{popup_height}+{x}+{y}")

    # Add a label and progress bar
    label = ttk.Label(popup, text=message)
    label.pack(pady=10)

    progress = ttk.Progressbar(popup, mode="indeterminate")
    progress.pack(pady=10, fill=tk.X, padx=10)
    progress.start()

    # Ensure args is optional
    args = args if args else ()

    # Start the task by calling after() method
    root.after(100, lambda: run_task(popup, task, *args))






# This function will run the task incrementally without freezing the UI
def run_task(popup, task, *args):
    global task_running, task_should_terminate

    try:
        if not task_should_terminate:
            task(*args)  # Execute the actual task

        if not task_should_terminate:
            message = "Task completed successfully!"
        else:
            message = "Task was terminated by the user."
    except Exception as e:
        message = f"Task failed: {str(e)}"
    finally:
        task_running = False
        root.after(0, lambda: complete_task(popup, message))

def complete_task(popup, message):
    """Handle task completion."""
    popup.destroy()  # Close the progress popup
    messagebox.showinfo("Status", message)  # Show a messagebox with the result



